import { useEffect, useState } from 'react';
import { api } from '../services/api';

type OrdemProducao = {
  id: number;
  produto: { nome: string };
  quantidade: number;
  status: string;
  createdAt?: string;
};

export function StatusProducao() {
  const [ordens, setOrdens] = useState<OrdemProducao[]>([]);

  useEffect(() => {
    api.get('/ordens-producao').then(res => setOrdens(res.data));
  }, []);

  return (
    <div>
      <h1>Status das Ordens de Fabricação</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Produto</th>
            <th>Quantidade</th>
            <th>Status</th>
            <th>Data</th>
          </tr>
        </thead>
        <tbody>
          {ordens.map(ordem => (
            <tr key={ordem.id}>
              <td>{ordem.id}</td>
              <td>{ordem.produto?.nome}</td>
              <td>{ordem.quantidade}</td>
              <td>{ordem.status}</td>
              <td>{ordem.createdAt ? new Date(ordem.createdAt).toLocaleString() : ''}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
